import Switch from "react-switch";
import './App.css';



function App() {

  this.state = { checked: false };
  this.handleChange = this.handleChange.bind(this);

  function switchTheme(checked){
    console.log("The state is: " + checked);
  }

  return (
    <div className="App">
      <div className="SidePanel">
        <Switch onChange={this.switchtheme} checked={this.state.checked}/>
      </div>
    </div>
  );
}

export default App;
